                          "title": "Pridobi podatke iz zemljiške knjige: - sledi povezavi (https://evlozisce.sodisce.si/esodstvo/index.html) - prijavite se kot registriran uporabnik  - vpišite e-mail in kliknite na “nov uporabnik”  - po prejemu gesla se vpišite v register  - izberite e-opravila kot Registriran uporabnik, eZK-opravila - zemljiška knjiga  - po vpisu varnostnega gesla izberite: 03-011 redni izpis iz zemljiške knjige  - vpišite katastrsko občino in parcelno številko - kliknite izpis v pdf obliki. V tem pdf dokumentu so podatki o lastništvu nepremičnine.",
